import React from 'react';
import './Home.scss';

const Home: React.FC = () => {
  return (
    <div className="home-page">
      <div className="welcome-message">
        <h1>Добро пожаловать в ECOSIM</h1>
        <p>Ваш баланс: 1000</p>
      </div>
      <div className="dashboard-placeholder">
        <p>Скоро здесь появится информация о ваших бизнесах</p>
      </div>
    </div>
  );
};

export default Home;
